import React from "react";
import logo from "../images/logo.png";
import "../styles/_header.scss";

const Header = () => {
  return (
    <header className="header">
      <div className="logo">
        <img src={logo} alt="Logo" />
        <span className="d-none d-lg-block">NiceAdmin</span>
      </div>

    </header>
  );
};

export default Header;
